@Vũ nương
- Tức nàng Vũ Thị Thiết
- Truyền kỳ mạn lục: Vũ Thị Thiết là cô gái xinh đẹp nết na quê ở huyện Nam Xương, đẹp duyên cùng chàng họ Trương. Khi hương lửa đang nồng, chàng Trương phải đi lính xa. Lúc ấy nàng đang mang thai. ít lâu sau nàng sinh được một đứa con trai. ở nhà mẹ con bìu ríu nuôi nhau. Tối tối, nàng thường chỉ vào bóng mình trên vách mà đùa với con rằng: "Bố con đấy". Thời gian thắm thoắt, chàng Trương mãn hạn trở về, đứa trẻ không nhận bố lại bảo rằng: "Bố con tối mới đến cơ, mẹ đi bố cùng đi, mẹ ngồi bố cùng ngồi." Trương sinh nghi bèn ruồng rẫy mắng nhiếc vợ phụ tình bạc nghĩa. Nàng họ Vũ khóc lóc phân trần thế nào cũng không lọt tai chồng, buồn rầu mới nhảy xuống sông Hoàng Giang tự tử. Về sau, câu chuyện được sáng tỏ, chàng Trương hối hận bèn cho dựng đàn giải oan ở bờ sông

